import Axios from 'axios';
import React from 'react';

import Nav from './nav'


class Home extends React.Component {

    componentDidMount() {
        const config = {
            headers: {
                Authorization: 'Bearer ' + localStorage.getItem('token')
            }
        };

        Axios.get('users', config).then(
            res => {
                console.log(res);
            },
            err => {
                console.log(err);
            }
        )
    }

    render() {
        return (
            <div>
                <Nav/>
                <h2>You are not logged in</h2>
            </div>
        )        
    }
}

export default Home;
